        supraTab.aBoolean266 = false;
        supraTab.anIntArray240 = new int[2]; // Make all 3 the same
        supraTab.anIntArray241 = new int[2]; // the last addSupraClick is "1" +1 = "2"
        supraTab.anIntArray272 = new int[2]; // If putted the ronge number in here your client wont load.


        supraTab.anIntArray240[0] = 19001; // always do +1 
        supraTab.anIntArray241[0] = 3; // <-> postion (pixels)
        supraTab.anIntArray272[0] = 5; // ^-v postion (pixels)

        supraTab.anIntArray240[0] = 19002; // always do +1 
        supraTab.anIntArray241[0] = 66; // <-> postion (pixels)
